            },
            "monthly": {
              "current": 7,
              "previous": 11
            }
          }
        }
      ]

  return (
    <SectionWrapper>
        <DesktopSection>
            <Left>
                <ProfileDiv>
                    <RoundImg><Logo src={jeremy} alt="Image" /></RoundImg>
